import "./App.css";
import GlassmorphismBox from "./components/glass";
import Navbar from "./components/navbar";

function App() {
	let Component;
	switch (window.location.pathname) {
		case "/":
			Component = App;
			break;
		case "/about":
			Component = App;
			break;
		case "/blog":
			Component = App;
			break;
		case "/signup":
			Component = App;
			break;
		case "/login":
			break;
	}
	return (
		<div className="App">
			<Navbar />
			<GlassmorphismBox />
		</div>
	);
}

export default App;
